顺便科普一波switch的用法:

**【语句格式】**

```cpp
switch(表达式)
{
    case 常量表达式1:
         语句序列;
         break;
    case 常量表达式2:
         语句序列;
         break;
         ...
    case 常量表达式n:
         语句序列;
         break;
    default:
         语句序列n+1;
}
```
